import React from "react";
import "./Home.css";

function Home() {
  return (
    <div>
        <nav className="navbar-custom">
            <a href="/" className="navbar-brand">
                <img src="images/icons/home/home-32.png" alt="Home" title="Home" className="icon-img"/>
            </a>
            <button className="btn icon-btn float-right" onClick={() => alert("Login/Register process")}>
                <img src="images/icons/login/home-login-32.png" alt="Login/Register" title="Login/Register" className="icon-img"/>
            </button>
        </nav>
        <div className="text-center">
            <h1>Welcome to the Invoice Management System</h1>
            <p>This is the home page. Please log in to access your account.</p>
        </div>
    </div>
  );
}

export default Home;
